import styled from "styled-components";
import React from "react";
import ReactDOM from "react-dom";
import "./Company.css";

const Sc_h2 = styled.h2`
  margin: 8px auto;
`;

function Company(props) {
  const { company } = props;
  return (
    <Sc_div>
      <img src={company.img} />
      <Sc_h2>{company.name}</Sc_h2>
      <Sc_h2>{company.category}</Sc_h2>
      <p>
        {" "}
        {company.ratings} {company.deliveryTime}
      </p>
    </Sc_div>
  );
}

export default Company;
